import "./projects.css"

const Project = () => {
    return (
        <div className="projects">
            <img className="Picture" src="./Components/Projects/download.png" alt="Girl in a jacket"></img>
            <div>
                <h2 className="Project_Name">Project Name</h2>
                <text className="Description">Description</text>
                <text className="Coach">Coach: Timothy</text>
                <text className="Students">Students:</text>
            </div>
        </div>
    );
};

export default Project;
